#!/usr/bin/env ruby

REGEXP = Regexp.union(('a'..'z').flat_map {|l| [l+l.upcase, l.upcase+l] })

def react!(string)
  true while string.gsub!(REGEXP, '')
  string
end

string = DATA.read
p react!(string.dup).size

puts ('a'..'z').map {|l| [l, react!(string.gsub(/#{l}/i, '')).size] }.min_by(&:last).last

__END__
